A Brief History of Time (subtitled &quot;From the Big Bang to Black Holes&quot;) is a popular science book written by Stephen Hawking and first published by the Bantam Dell Publishing Group in 1988. It became a best-seller and has sold more than 10 million copies. It was also on the London Sunday Times best-seller list for more than four years.

